INSERT INTO `ps_cms_lang` VALUES
('1','1','1','Dostawa',NULL,'Nasze zasady i warunki dostawy','paczka, dostawa, warunki, wysyłka, opóźnienie','<h1 style=\"margin:18px 0px 25px;padding:0px;border:0px;font-weight:500;line-height:1.1;font-family:PlayFairRegular;font-size:33px;vertical-align:baseline;color:#28282a;background-color:#fafafa;\">Wysyłka</h1>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">Towarowy zakupione w sklepie internetowym bylight.pl wysyłamy za pośrednictwem firmy kurierskiej DPD. Z reguły (o ile mamy towar na stanie) realizujemy wysyłki w 24h od momentu zaksięgowania środków na koncie.<br /><br />Dużym ułatwieniem i przyspieszeniem procesu jest zakup produktów przez platformę Dotpay (szybkie przelewy). Eliminuje to okres oczekiwania na księgowanie przelewu tradycyjnego.<br /><br />Koszt przesyłki kurierskiej wynosi 14,90 za zwykłą wysyłkę oraz 17,90 za przesyłkę za pobraniem.<br /><br />Koszty przesyłki zostaną pokryte przez firmę Bylight jeżeli wartość zamówienia będzie wynosić conajmniej 400,00 zł.</p>','dostawa'),
('2','1','1','Nota prawna',NULL,'Nota prawna','nota, prawna','<h2>Nota prawna</h2>\n<p>Koncepcja i produkcja:</p>\n<p>Ta witryna internetowa została stworzona przy użyciu oprogramowania open-source <a href=\"http://www.prestashop.com\">PrestaShop</a>™</p>','nota-prawna'),
('3','1','1','Regulamin użytkowania',NULL,'Nasze warunki użytkowania','warunki, sprzedaż, użytkowanie','<h1 style=\"margin:18px 0px 25px;padding:0px;border:0px;font-weight:500;line-height:1.1;font-family:PlayFairRegular;font-size:33px;vertical-align:baseline;color:#28282a;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;vertical-align:baseline;\">REGULAMIN SKLEPU INTERNETOWEGO WWW.BYLIGHT.PL</b> <b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;vertical-align:baseline;\"> </b></h1>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">Sprzedawane i prezentowane żarówki dekoracyjne Edisona zgodnie z dyrektywą 2005/32/we przeznaczone są do specjalnego zastosowania, nie są przeznaczone do użytku domowego.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">I. DEFINICJE</b></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">Pojęcia użyte w Regulaminie oznaczają:</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">1. Informacja Handlowa – </b>informacja handlowa w rozumieniu art. 2 pkt 2) Ustawy o świadczeniu usług drogą elektroniczną, w szczególności zaś reklamy, oferta handlowa oraz informacje o aktualnościach, promocjach i innych wydarzeniach dotyczących Sklepu</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">2. Klient </b>– osoba fizyczna, osoba prawna lub jednostka organizacyjna nie będąca osobą prawną, której przepisy szczególne przyznają zdolność prawną, składająca Zamówienie w ramach Sklepu</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">3. Kodeks Cywilny </b>– ustawa z dnia 23 kwietnia 1964 roku (Dz.U. Nr 16, poz. 93 ze zm.)</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">4. Regulamin</b> – niniejszy regulamin wraz ze wszystkimi załącznikami stanowiącymi jego integralną część, w tym w szczególności „Polityką Prywatności” i „Warunkach i Cenniku Dostaw”;</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">5. Sklep Internetowy, Sklep</b> – sklep internetowy dostępny pod adresem www.bylight.pl, za pośrednictwem którego Klient może dokonywać zakupów określonych Towarów</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">6. Towar </b>– produkty prezentowane w ramach Sklepu, w tym w szczególności żarówki, kolorowe przewody, oprawki, lampy, akcesoria elektryczne.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">7. Umowa Sprzedaży </b>– umowa sprzedaży Towarów zawarta pomiędzy Właścicielem Sklepu a Klientem za pośrednictwem serwisu internetowego Sklepu</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">8. Ustawa o szczególnych warunkach sprzedaży konsumenckiej </b>– ustawa z dnia 27 lipca 2002 roku o szczególnych warunkach sprzedaży konsumenckiej oraz o zmianie Kodeksu Cywilnego (Dz.U. Nr 141, poz. 1176 ze zm.)</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">9. Ustawa o świadczeniu usług drogą elektroniczną </b>– ustawa z dnia 18 lipca 2002 roku o świadczeniu usług drogą elektroniczną  (Dz.U. Nr 144, poz. 1204 ze zm.)</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">10. Właściciel Sklepu </b>– Paweł Nastański prowadzący jednoosobową działalność gospodarczą pod firmą Bylight z siedzibą przy ul. Burakowskiej 15, 01-066 w Warszawie<b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">, NIP: </b>125-139-20-15<b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">, REGON: </b>147424625, działająca na podstawie wpisu do Centralnej Ewidencji Działalności Gospodarczej.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">11. Zamówienie </b>– czynność podejmowana przez Klienta polegająca na wyborze w ramach Sklepu określonych Towarów, zmierzająca bezpośrednio do zawarcia z Właścicielem Sklepu Umowy Sprzedaży tych Towarów na warunkach wskazanych w niniejszym Regulaminie</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"> </p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">II. POSTANOWIENIA OGÓLNE</b></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">1. Sklep Internetowy dostępny pod adresem www.bylight.pl prowadzony jest przez Bylight Paweł Nastański, tj. Właściciela Sklepu.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">2. Informacje o Towarach podane na stronach internetowych Sklepu, w szczególności ich opisy, parametry techniczne oraz ceny, nie stanowią oferty w rozumieniu Kodeksu Cywilnego, a są jedynie zaproszeniem do zawarcia umowy w rozumieniu art. 71 Kodeksu Cywilnego.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">3. Zasady korzystania ze Sklepu Internetowego oraz warunki dokonywania w jego ramach zakupów określa niniejszy Regulamin.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">4. Niniejszy Regulamin określa w szczególności:</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ warunki i zasady składania w ramach Sklepu Zamówień,</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ zasady zawierania Umów Sprzedaży, których przedmiotem są określone Towary, oraz</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ procedurę reklamacyjną.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">5. Warunkiem korzystania ze Sklepu jest zapoznanie się z treścią Regulaminu i jego akceptacja. Akceptując Regulamin Klient wyraża zgodę na jego wszystkie postanowienia i zobowiązuje się do ich przestrzegania.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">6. Właściciel Sklepu nieodpłatnie udostępnia Klientowi Regulamin przed rozpoczęciem korzystania ze Sklepu Internetowego. Treść niniejszego Regulaminu może zostać utrwalona przez Klienta poprzez jego wydrukowanie, zapisanie na nośniku lub pobranie w każdej chwili ze strony http://bylight.pl/regulamin/</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"> </p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">III. TECHNICZNE WARUNKI KORZYSTANIA Z SERWISU</b></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">1. Korzystanie ze Sklepu Internetowego możliwe jest pod warunkiem spełnienia po stronie Klienta następujących wymagań technicznych:</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ posiadanie urządzenia umożliwiającego dostęp do sieci Internet, wyposażonego w sprawny system operacyjny, np. Linux lub Windows, IOS, OSX</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ zainstalowanie na urządzeniu, o którym mowa w pkt. a) powyżej najnowszej, aktualnej wersji przeglądarki internetowej zapewniającej dostęp do zasobów sieci Internet, takiej jak: Internet Explorer, Opera, Mozilla Firefox, Safari, Google Chrome lub innej kompatybilnej, oraz</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ posiadanie aktywnego konta poczty e-mail.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"> </p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">IV. SKŁADANIE I REALIZACJA ZAMÓWIEŃ </b></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">1. W celu zamówienia Towaru za pośrednictwem Sklepu należy wejść na stronę internetową www.bylight.pl, a następnie dokonać wyboru Towaru, podejmując kolejne kroki zgodnie z komunikatami wyświetlanymi na stronach Sklepu.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">2. Wybór przez Klienta zamawianych Towarów (w tym ich rodzaju oraz liczby) dokonywany jest poprzez dodanie poszczególnych Towarów do koszyka.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">3. Celem złożenia Zamówienia konieczne jest podanie przez Klienta następujących danych:</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ imię, nazwisko albo nazwa firmy,</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ NIP (w przypadku Klientów, innych niż osoby fizyczne),</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ adres zamieszkania albo siedziba (tj. ulica, nr domu, nr lokalu, miejscowość, kod pocztowy, kraj),</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ numer telefonu,</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ adres e-mail.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">4. W procesie składania Zamówienia Klient obowiązany jest ponadto określić czy dokonuje zakupów jako osoba prywatna czy jako przedsiębiorca, jak również wskazać adres dostawy wybranych Towarów, dokonać wyboru co do formy płatności za zamówione Towary oraz sposobu ich dostawy.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">5. W trakcie składania Zamówienia – do momentu kliknięcia w przycisk „Zamawiam” – Klient ma możliwość modyfikacji podanych przez siebie danych osobowych oraz danych w zakresie wybranych przez siebie Towarów, zarówno co do ich rodzaju i liczby (ilości), jak również co do formy płatności za zamówione Towary oraz miejsca i formy ich dostawy.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">6. Po podaniu przez Klienta wszystkich niezbędnych danych do złożenia Zamówienia, wyświetlone zostanie podsumowanie Zamówienia. Podsumowanie złożonego Zamówienia będzie zawierać następujące informacje:</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ określenie liczby i rodzaju zamówionych Towarów,</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ cena Towaru oraz koszty dostawy,</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ dane osobowe zamawiającego Klienta,</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ formę odbioru i adres dostawy zamówionego Towaru.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">7. W celu wysłania Zamówienia w treści zgodnej z powiadomieniem wskazanym w ust. 6 powyżej, konieczne jest dokonanie akceptacji Regulaminu poprzez kliknięcie przycisku „Przeczytałem i akceptuję regulamin”, a następnie kliknięcie na przycisk „Złóż zamówienie” a potem “Potwierdzam”.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">8. Wysłanie przez Klienta Zamówienia stanowi oświadczenie woli Klienta zawarcia z Właścicielem Sklepu Umowy Sprzedaży, zgodnie z treścią niniejszego Regulaminu.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">9. Po złożeniu Zamówienia do Klienta zostanie wysłana wiadomość e-mail zawierająca ostateczne potwierdzenie wszystkich istotnych elementów Zamówienia.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">10. Umowę Sprzedaży traktuje się jako zawartą z chwilą otrzymania przez Klienta wiadomości, o której mowa w ust. 9 powyżej. Umowa Sprzedaży zostaje zawarta w języku polskim w treści zgodnej z Regulaminem.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"> </p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">V. CENY TOWARÓW I FORMY PŁATNOŚCI</b></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">1. Ceny towarów zamieszczone na stronie internetowej Sklepu są cenami brutto i zawierają podatek VAT oraz wszelkie inne składniki, takie jak np. cła.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">2. Właściciel Sklepu zastrzega sobie prawo do zmiany cen Towarów prezentowanych na stronach internetowych Sklepu, wprowadzania nowych Towarów, przeprowadzania i odwoływania wszelkiego rodzaju akcji promocyjnych oraz wyprzedaży. Powyższe uprawnienie nie ma wpływu na Zamówienia, które zostały złożone przed datą wejścia w życie zmiany ceny, warunków akcji promocyjnych lub wyprzedaży.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">3. Klient może wybrać następujące formy płatności za zamówione Towary:</p>\n<ul style=\"margin:0px 0px 9px;padding:0px 0px 0px 15px;border:0px;line-height:inherit;font-family:\'montserrat_light\';font-size:13px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">\n<li style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;vertical-align:baseline;\">Przelewem elektronicznym – płatne bezpośrednio na konto Właściciela Sklepu – na przelewie w polu „Tytułem”, prosimy podać numer Zamówienia. Wysyłka zamówionego Towaru nastąpi po otrzymaniu przelewu.</li>\n<li style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;vertical-align:baseline;\">Rozliczenia transakcji kartą kredytową i e-przelewem przeprowadzane są za pośrednictwem Dotpay.pl</li>\n</ul>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">4. Do każdego Zamówienia wystawiany jest paragon. Na życzenie Klienta Właściciel Sklepu wystawia faktury VAT.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"> </p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">VI. KOSZTY I TERMIN DOSTAWY </b></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">1. Dostawa Towarów ograniczona jest do obszaru Rzeczpospolitej Polskiej i realizowana jest w formie przesyłki kurierskiej.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">2. Koszty dostawy podane są do wiadomości Klienta przed wysłaniem przez niego Zamówienia.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">3. W przypadku, gdyby dostawa zamówionego Towaru miała nastąpić poza granice Rzeczpospolitej Polskiej prosimy o kontakt mailowy celem ustalenia formy i kosztów dostawy.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"> </p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">VII. REKLAMACJE DOTYCZĄCE TOWARÓW</b></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">1. Wszystkie Towary dostępne w Sklepie są oryginalne i fabrycznie nowe.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">2. Właściciel Sklepu odpowiada wobec Klienta, będącego konsumentem w rozumieniu art. 22<span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">1</span> Kodeksu Cywilnego za niezgodność z Umową Sprzedaży Towaru zakupionego przez Klienta, w zakresie określonym Ustawą o szczególnych warunkach sprzedaży konsumenckiej.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">3. Reklamacje, wynikające z naruszenia praw Klienta gwarantowanych prawnie, lub na podstawie niniejszego Regulaminu, należy kierować do Właściciela Sklepu na adres e-mail sklep@bylight.pl</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">4. Zgłaszając reklamację należy podać imię, nazwisko, adres e-mail, numer Zamówienia, a także opisać powód składanej reklamacji.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">5. Sklep zobowiązuje się do rozpatrzenia każdej reklamacji w terminie do 14 (czternastu) dni od dnia jej zgłoszenia.<b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\"> </b></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"> </p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">VIII. REKLAMACJE DOTYCZĄCE FUNKCJONOWANIA SERWISU SKLEPU</b></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">1. Właściciel Sklepu podejmuje działania w celu zapewnienia w pełni poprawnego działania serwisu Sklepu Internetowego i zobowiązuje się do usuwania na bieżąco wszelkich nieprawidłowości w jego funkcjonowaniu zgłaszanych przez Klientów.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">2. Klient może poinformować Właściciela Sklepu o wszelkich nieprawidłowościach lub przerwach w funkcjonowaniu serwisu Sklepu poprzez wysłanie stosownej informacji na adres e-mail sklep@bylight.pl.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">3. W wiadomości e-mail, o której mowa w ust. 2 powyżej Klient powinien podać swoje imię, nazwisko, adres do korespondencji (w tym adres e-mail), a także rodzaj i datę wystąpienia nieprawidłowości związanej z funkcjonowaniem serwisu Sklepu.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">4. Właściciel Sklepu zobowiązuje się do rozpatrzenia reklamacji w terminie do 14 (czternastu) dni od dnia jej wpłynięcia.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"> </p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">IX. ZWROTY</b></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">1. Zgodnie z ustawą z dnia 2 marca 2000 roku o ochronie niektórych praw konsumentów oraz o odpowiedzialności za szkodę wyrządzoną przez produkt niebezpieczny (Dz.U.2012.1225), Klient będący konsumentem w rozumieniu art. 22<span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">1</span> Kodeksu Cywilnego może odstąpić od Umowy Sprzedaży bez podania przyczyny, w ciągu 10 (dziesięciu) dni od dnia odebrania Towaru, poprzez wysłanie na piśmie stosownego oświadczenia na adres siedziby Właściciela Sklepu, tj.: ByLight.pl ul. Burakowska 15, 01-066 Warszawa.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">2. W przypadku odstąpienia od Umowy Sprzedaży umowę taką uważa się za niezawartą, a strony zobowiązane są zwrócić to co sobie na jej podstawie wzajemnie świadczyły.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">3. Towar ulega zwrotowi w stanie niezmienionym, chyba że zmiana była konieczna w granicach zwykłego zarządu. Zwrot powinien nastąpić niezwłocznie, nie później niż w terminie 14 (czternastu) dni od dnia odstąpienia Klienta będącego konsumentem w rozumieniu art. 22<span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">1</span> Kodeksu Cywilnego od Umowy Sprzedaży. Zwracany Towar należy przesłać na adres: ByLight.pl ul. Burakowska 15, 01-066 Warszawa.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">4. Zwracany Towar powinien zostać opakowany w sposób zapewniający brak uszkodzeń przesyłki w transporcie.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">5. W przypadku Lampki Lumica, malowanych na zamówienie lamp Soul oraz innych lamp produkowanych według specyfikacji Klienta, również girland  – w związku z faktem, iż jest to produkt składany na Państwa konkretne zamówienie – wybór podstawki, koloru ceramiki i przewodu, koloru oraz kształtu podzespołów wyprodukowanych na specjalne zamówienie Klienta nie ma możliwości zwrotu towaru, jeśli ten nie jest uszkodzony lub nie posiada wad produkcyjnych.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">6. W przypadku zakupu przewodów (kolorowe kable) – w związku z faktem, iż jest to produkt docinany zgodnie z Państwa zamówieniem, nie ma możliwości zwrotu towaru.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">7. Właściciel Sklepu dokona zwrotu wartości Zamówienia wraz z kosztami dostawy niezwłocznie, nie później jednak niż w terminie 14 (czternastu) dni od dnia odstąpienia przez Klienta będącego konsumentem w rozumieniu art. 22<span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">1</span> Kodeksu Cywilnego od Umowy Sprzedaży.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">8. Koszt odesłania Towaru oraz opakowania pokrywa Klient.<b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\"> </b></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">9. W paczce ze zwracanym towarem poza protokolem zwrotu towaru musi znaleźć się również oryginał paragonu.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"> </p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">X. POZOSTAŁE ZASADY KORZYSTANIA ZE SKLEPU INTERNETOWEGO</b></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">1. Klient, korzystając ze Sklepu zobowiązany jest w szczególności do:</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ niedostarczania i nieprzekazywania treści zabronionych przez przepisy prawa, w tym w szczególności treści obraźliwych lub wulgarnych, nawołujących do przemocy lub innych działań sprzecznych z prawem lub dobrymi obyczajami, albo które naruszają dobra osobiste i inne prawa osób trzecich,</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ korzystania ze Sklepu w sposób zgodny z jego przeznaczeniem i niezakłócający jego funkcjonowania, a także w sposób nieuciążliwy dla pozostałych Klientów Sklepu,</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ niewykorzystywania Sklepu do przesyłania lub zamieszczania w ramach Sklepu niezamówionej Informacji Handlowej (spamu),</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ korzystania z wszelkich treści zamieszczonych na stronach internetowych Sklepu wyłącznie dla swojego osobistego użytku,</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ korzystania ze Sklepu w sposób zgodny z Regulaminem, właściwymi przepisami prawa oraz ogólnymi zasadami korzystania z Internetu (netykietą).</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"> </p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">XI. OCHRONA DANYCH OSOBOWYCH</b></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">1. Właściciel Sklepu jako administrator danych osobowych zobowiązuje się podjąć wszelkie konieczne środki techniczne i organizacyjne odpowiednie do stopnia zagrożenia, w celu zapewnienia bezpieczeństwa wszystkich danych i treści przekazywanych przez Klienta w związku z korzystaniem przez niego ze Sklepu Internetowego.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">2. Dane osobowe Klientów przetwarzane są zgodnie z postanowieniami ustawy z dnia 29 sierpnia 1997 roku o ochronie.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">3. Szczegółowe zasady dotyczące przetwarzania danych osobowych Klientów zawiera Polityka Prywatności znajdująca się na stronie http://bylight.pl/regulamin/</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"> </p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">XII. POSTANOWIENIA KOŃCOWE</b></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">1. Zdjęcia oraz pozostałe materiały (w tym teksty, grafiki, logotypy) zamieszczone na stronie Sklepu są własnością Właściciela Sklepu lub zostały użyte przez niego za zgodą ich właścicieli. Wykorzystywanie ich w celach komercyjnych bez zgody Właściciela jest nielegalne i zabronione zgodnie z ustawą z dnia 4 lutego 1994 roku o prawie autorskim i prawach pokrewnych (Dz.U.2006, Nr 90, poz. 631).</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">2. Rozstrzyganie ewentualnych sporów pomiędzy Właścicielem Sklepu a Klientem, który jest konsumentem w rozumieniu art. 22<span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">1</span> Kodeksu Cywilnego, zostaje poddane sądom właściwym zgodnie z właściwymi przepisami Kodeksu postępowania cywilnego.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">3. Rozstrzyganie ewentualnych sporów pomiędzy Właścicielem Sklepu a Klientem, który nie jest konsumentem w rozumieniu art. 22<span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">1</span> Kodeksu Cywilnego, zostaje poddane sądowi właściwemu ze względu na siedzibę Właściciela Sklepu.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">4. W sprawach nie uregulowanych w niniejszym Regulaminie zastosowanie mają właściwe przepisy prawa polskiego.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"> </p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">POLITYKA PRYWATNOŚCI SKLEPU WWW.BYLIGHT.PL.</b></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">1. Niniejsza Polityka Prywatności określa zasady przetwarzania danych osobowych pozyskanych od Użytkowników w związku z korzystaniem ze Sklepu Internetowego, przez ich Administratora.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">2. Administratorem danych osobowych jest Właściciel Sklepu, tj. Paweł Nastański, działający na podstawie wpisu do Centralnej Ewidencji Działalności Gospodarczej. Właściciel Sklepu przetwarza dane osobowe Użytkowników zgodnie z przepisami prawa, w tym w szczególności z przepisami ustawy z dnia 29 sierpnia 1997 roku o ochronie danych osobowych (Dz.U. Nr 133, poz. 883 z późn. zm.) oraz ustawy z dnia 18 lipca 2002 roku o świadczeniu usług drogą elektroniczną (Dz.U. Nr 144, poz. 1204 z późn. zm.).</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">3. Właściciel Sklepu, jako Administrator danych osobowych dba o bezpieczeństwo danych osobowych udostępnionych przez Użytkowników w związku z korzystaniem przez nich ze Sklepu Internetowego, w szczególności poprzez stosowną ich ochronę oraz zabezpieczenie danych osobowych przed dostępem osób nieupoważnionych.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">4. Z zastrzeżeniem zapisów ust. 12-16 poniżej, Właściciel Sklepu Internetowego przetwarza dane osobowe Użytkowników (tj. imię, nazwisko Użytkownika, adres, w tym: nazwa ulicy, numer domu lub mieszkania, miasto, kod, kraj oraz adres e-mail, numer telefonu Użytkownika oraz adres wysyłki, jeżeli jest inny niż ten, o którym mowa powyżej) w zakresie niezbędnym do realizacji zamówienia i wykonania umowy sprzedaży, w tym do jej nawiązania, ukształtowania bądź zmiany jej treści, a także jej rozwiązania.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">5. Adres e-mail Użytkownika wykorzystywany jest także w celach marketingowych, w szczególności do wysyłki <span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">newslettera</span>, pod warunkiem jednakże, że na takie działania Użytkownik wyrazi zgodę.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">6. Podanie danych osobowych, o których mowa w ust. 4 powyżej jest dobrowolne, jednak ich niepodanie uniemożliwia korzystanie ze Sklepu Internetowego i składanie w jego ramach zamówień.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">7. Wyrażenie zgody przez Użytkownika na przetwarzanie jego danych osobowych w celach marketingowych, o której mowa w ust. 5 powyżej, nie jest konieczne do korzystania ze Sklepu Internetowego i składania w jego ramach zamówień.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">8. Właściciel Sklepu Internetowego może wskazać inne niż podane w ust. 4 powyżej dane osobowe Użytkowników służące realizacji określonych czynności w trakcie dokonywania przez nich zakupów w Sklepie Internetowym, z tym zastrzeżeniem, iż mogą być one przetwarzane wyłącznie za uprzednią zgodą Użytkownika wyrażoną po powiadomieniu go przez Właściciela Sklepu Internetowego o kategorii tychże danych, celu i zakresie ich przetwarzania oraz o ich odbiorcach, chyba że przepisy prawa stanowią inaczej. Zgoda ta może być w każdym czasie odwołana.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">9. Użytkownik ma prawo do modyfikacji podanych przez siebie danych osobowych w każdym czasie poprzez zmianę ustawień swojego konta lub poprzez wysłanie stosownej wiadomości na adres e-mail sklep@bylight.pl.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">10. Użytkownik ma prawo odwołać w każdym czasie udzieloną uprzednio Właścicielowi Sklepu Internetowego zgodę na przetwarzanie jego danych osobowych, w tym także dla celów marketingowych, poprzez zmianę ustawień swojego konta lub poprzez wysłanie stosownej wiadomości na adres e-mail sklep@bylight.pl. Po usunięciu danych osobowych Użytkownika, Właściciel Sklepu nie jest uprawniony do ich dalszego przetwarza, chyba że takie uprawnienie wynikać będzie z właściwych przepisów prawa.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">11. Właściciel Sklepu jest uprawniony do udostępnienia danych osobowych Użytkowników wyłącznie podmiotom, które zostały do tego upoważnione na podstawie właściwych przepisów prawa.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">12. W związku z prowadzeniem Sklepu Internetowego, Właściciel Sklepu jest w posiadaniu adresów IP Użytkowników oraz informacji o rozpoczęciu, zakończeniu oraz zakresie korzystania ze sklepu, zapisywanych w logach systemowych. Informacje te wykorzystywane są do badań statystycznych i dotyczą wyłącznie tego, jaki adres IP i kiedy skorzystał ze strony internetowej Sklepu, nie są one natomiast zestawiane z żadnymi innymi danymi osobowymi poszczególnych Użytkowników.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">13. Poza danymi wskazanymi w ust. 12 powyżej, Sklep Internetowy w sposób automatyczny zbiera dane zawarte w plikach <span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">cookies</span> podczas samego korzystania ze sklepu Internetowego. Poprzez „pliki <span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">cookies</span>” należy rozumieć dane informatyczne, w szczególności pliki tekstowe, przechowywane w urządzeniach końcowych Użytkowników przeznaczone do korzystania ze stron internetowych.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">14. Pliki <span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">cookies</span> wykorzystywane są przez Wła<span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">ściciel</span>a Sklepu wyłącznie w celu obsługi Sklepu Internetowego, w tym aby rozpoznać urządzenie Użytkownika i wyświetlić serwis Sklepu Internetowego dostosowany do jego indywidualnych potrzeb, a także aby tworzyć anonimowe statystyki tego serwisu.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">15. Pliki <span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">cookies</span> nie są wykorzystywane do pozyskiwania jakichkolwiek danych osobowych o osobach odwiedzających Sklep Internetowy.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">16. Użytkownik w każdym wypadku może zablokować instalowanie plików <span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">cookies</span>, usunąć stałe pliki <span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">cookies </span>lub w inny sposób zmienić warunki przechowywania bądź otrzymywania plików<span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">cookies</span>, wykorzystując w tym celu stosowne opcje swojej przeglądarki internetowej, np.:</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ <a href=\"http://windows.microsoft.com/pl-PL/windows7/How-to-manage-cookies-in-Internet-Explorer-9\" style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;color:#7e7b90;\">w przeglądarce Internet Explorer</a>,</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ <a href=\"http://support.mozilla.org/pl/kb/ciasteczka\" style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;color:#7e7b90;\">w przeglądarce Mozilla Firefox</a>,</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ <a href=\"http://support.google.com/chrome/bin/answer.py?hl=pl&amp;answer=95647\" style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;color:#7e7b90;\">w przeglądarce Chrome</a>,</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ <a href=\"http://help.opera.com/Linux/9.22/pl/cookies.html\" style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;color:#7e7b90;\">w przeglądarce Opera</a>, albo</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">◦ <a href=\"http://support.apple.com/kb/HT1677?viewlocale=pl_PL&amp;locale=pl_PL\" style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;color:#7e7b90;\">w przeglądarce Safari</a> albo innej kompatybilnej</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">z tym zastrzeżeniem, że wyłączenie plików <span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">cookies</span> w przeglądarce może spowodować utrudnienia, a nawet uniemożliwić korzystanie ze Sklepu Internetowego.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"> </p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><b style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">WARUNKI I CENNIK DOSTAW.</b></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">1. Zamówione Towary dostarczamy na terytorium Polski za pośrednictwem firmy kurierskiej DPD na adres wskazany w formularzu zamówienia.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">2. W przypadku braku możliwości zrealizowania zamówienia w podanym czasie z przyczyn od nas niezależnych, skontaktujemy się z Państwem w celu ustalenia dalszego toku postępowania.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">3. Czas dostarczenia przesyłki przez firmę kurierską wynosi zwykle od 1 do 3 dni roboczych.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">4. Jeśli czas realizacji okazałby się dłuższy niż podany na stronach, kontaktujemy się z Kupującym, by poinformować go o opóźnieniu i potwierdzić dalszą chęć realizacji zamówienia. W przypadku rezygnacji z zamówienia Właściciel Sklepu dokona zwrotu wartości Zamówienia niezwłocznie nie później jednak niż w terminie 14 (czternastu) dni od dnia odstąpienia przez Klienta będącego konsumentem w rozumieniu art. 22<span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">1</span> Kodeksu Cywilnego od Umowy Sprzedaży.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">5. Koszt wysyłki zostanie doliczony do produktów znajdujących się w Państwa koszyku. Obie kwoty składają się na ostateczny koszt zamówienia.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">6. Koszt wysyłki za pomocą kuriera wynosi 18,00 zł brutto.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">7. Istnieje możliwość przesłania towaru poza granicę Polski. Prosimy o kontakt, gdyż koszt jest każdorazowo ustalany indywidualnie, zależnie od wagi zamówienia i kraju dostawy.</p>','regulamin-uzytkowania'),
('4','1','1','O Nas',NULL,'Dowiedz się więcej o nas','o nas, informacje','<h1 style=\"margin:18px 0px 25px;padding:0px;border:0px;font-weight:500;line-height:1.1;font-family:PlayFairRegular;font-size:33px;vertical-align:baseline;color:#28282a;background-color:#fafafa;text-align:center;\">Dowiedz się więcej o nas</h1>\n<h2 style=\"margin:40px 0px;padding:0px;border:0px;font-weight:500;line-height:60px;font-family:PlayFairRegular;font-size:44px;vertical-align:baseline;color:#28282a;background-color:#fafafa;\">Kiedy pasjonaci biorą się za robienie lamp... </h2>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">Jesteśmy grupą projektantów, inżynierów, rzemieślników, którym przyświeca jeden cel: tworzenie pięknych lamp i akcesoriów oświetleniowych najwyższej jakości. Do każdej przestrzeni. I dla każdego. </span></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">Inspirujemy się najlepszym designem minionego wieku. Uwielbiamy dbałość o detale z jaką wtedy podchodziło się do produkcji oświetlenia. </span></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">Nasze produkty wychodzą spod rąk prawdziwych pasjonatów. Ludzi, którzy tworzą lampy od ponad 40-stu lat używając tradycyjnych<br />i sprawdzonych metod. Troska o jakość każdego, nawet najdrobniejszego elementu, zawsze bierze górę nad szybkością czy łatwością wykonania. </span></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\"><img src=\"https://bylight.pl/img/cms/Zdj%C4%99cia%20z%20Katalogu/2.jpg\" alt=\"tp1.png\" width=\"670\" height=\"550\" style=\"margin:4px 0px 17px;padding:0px;border:0px;line-height:inherit;font-size:13px;vertical-align:middle;width:662.3px;height:auto;\" /></span></p>\n<h2 style=\"margin:40px 0px;padding:0px;border:0px;font-weight:500;line-height:60px;font-family:PlayFairRegular;font-size:44px;vertical-align:baseline;color:#28282a;background-color:#fafafa;\"><span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;vertical-align:baseline;\">W ByLight wszystko </span>robione jest rękami. Naszymi. </h2>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">Każdy projekt zaczynamy od szkicu na papierze, a potem zabieramy się za niego naszymi rękami. Wszystkiego chcemy dotknąć, sprawdzić, wymodelować, przycisnąć, rozciągnąć... tak, żeby powstało prawdziwe dzieło sztuki użytkowej. </span></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">Dlatego ponad 90% elementów i detali naszych lamp jest wykonywanych ręcznie lub za pomocą maszyn obsługiwanych przez ludzi. Nie ma u nas miejsca na automatyzację, robotyzację czy tworzenie tysiąca takich samych produktów. Chcemy, aby każda lampa wychodząca od nas była wyjątkowa. W tej kwestii jesteśmy staroświeccy. </span></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"><span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\"><img src=\"https://bylight.pl/img/cms/Zdj%C4%99cia%20z%20Katalogu/8.jpg\" alt=\"tp2.png\" width=\"670\" height=\"550\" style=\"margin:4px 0px 17px;padding:0px;border:0px;line-height:inherit;font-size:13px;vertical-align:middle;width:679.612px;height:auto;\" /></span></p>\n<div class=\"page\" title=\"Page 5\" style=\"margin:0px;padding:0px;border:0px;line-height:inherit;font-family:\'montserrat_light\';font-size:13px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">\n<div class=\"layoutArea\" style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;vertical-align:baseline;\">\n<div class=\"column\" style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;vertical-align:baseline;\">\n<h2 style=\"margin:40px 0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:500;line-height:60px;font-family:PlayFairRegular;font-size:44px;vertical-align:baseline;color:#28282a;\"><span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;vertical-align:baseline;\">Jesteśmy mistrzami w swoim fachu.</span></h2>\n</div>\n</div>\n</div>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-family:\'montserrat_light\';font-size:13.8px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\"></p>\n<div class=\"page\" title=\"Page 5\" style=\"margin:0px;padding:0px;border:0px;line-height:inherit;font-family:\'montserrat_light\';font-size:13px;vertical-align:baseline;color:#7e7b90;background-color:#fafafa;\">\n<div class=\"layoutArea\" style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;vertical-align:baseline;\">\n<div class=\"column\" style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;vertical-align:baseline;\">\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:18px;font-family:inherit;font-size:13.8px;vertical-align:baseline;\"><span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">Używamy już prawie zapomnianej metody drykowania, czyli obróbki plastycznej nadającej materiałowi wybrany kształt bez przerywania jego ciągłości. To umożliwia tworzenie fantazyjnych i unikalnych elementów z minimalną ilością strat w materiałach. Wykorzystujemy również najnowsze technologie nadające lampom wyjątkowe kolory i wzory. Cenimy </span>też klasyczne metody metalurgii.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:18px;font-family:inherit;font-size:13.8px;vertical-align:baseline;\"><img src=\"https://bylight.pl/img/cms/Zdj%C4%99cia%20z%20Katalogu/2_1.jpg\" alt=\"tp3.png\" width=\"670\" height=\"550\" style=\"margin:4px 0px 17px;padding:0px;border:0px;line-height:inherit;font-size:13px;vertical-align:middle;width:679.612px;height:auto;\" /></p>\n<h2 style=\"margin:40px 0px;padding:0px;border:0px;font-weight:500;line-height:60px;font-family:PlayFairRegular;font-size:44px;vertical-align:baseline;color:#28282a;\"><span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;vertical-align:baseline;\">Lampy od ByLight to wisienka na suficie pięknego pomieszczenia.</span></h2>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-size:13.8px;vertical-align:baseline;\"><strong style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">Lampy z naszej oferty.</strong></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-size:13.8px;vertical-align:baseline;\"><span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">Nasze lampy są ponadczasowe. Ręcznie wykonane<br />i wyjątkowe. Zależy nam na tym, aby poprzez personalizację każdy mógł stworzyć oświetlenie, które będzie idealnie pasowało do wnętrza i było ekspresją stylu użytkownika.</span></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-size:13.8px;vertical-align:baseline;\"><strong style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">Lampy na zamówienie.</strong></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-size:13.8px;vertical-align:baseline;\"><span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">Wyobraźnia nie ma ograniczeń. Dlatego wychodzimy naprzeciw osobom, które mają wizję wymarzonej lampy w głowie i nie mogą jej znaleźć w żadnym sklepie. Dzięki naszemu wieloletniemu doświadczeniu<br />i zapleczu produkcyjnemu, możemy zrealizować<br />nawet bardzo skomplikowane projekty. Chętnie współpracujemy z inwestorami, architektami i każdym, kto ceni dobry design.</span></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-size:13.8px;vertical-align:baseline;\"><span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\"><img src=\"https://bylight.pl/img/cms/Zdj%C4%99cia%20z%20Katalogu/10.jpg\" alt=\"tp4.png\" width=\"670\" height=\"550\" style=\"margin:4px 0px 17px;padding:0px;border:0px;line-height:inherit;font-size:13px;vertical-align:middle;width:679.612px;height:auto;\" /></span></p>\n<div class=\"layoutArea\" style=\"margin:0px;padding:0px;border:0px;line-height:inherit;vertical-align:baseline;\">\n<div class=\"column\" style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;vertical-align:baseline;\">\n<h2 style=\"margin:40px 0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:500;line-height:60px;font-family:PlayFairRegular;font-size:44px;vertical-align:baseline;color:#28282a;\"><span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;vertical-align:baseline;\">Nasze </span>projekty to nasza duma!</h2>\n</div>\n</div>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-size:13.8px;vertical-align:baseline;\"></p>\n<div class=\"layoutArea\" style=\"margin:0px;padding:0px;border:0px;line-height:inherit;vertical-align:baseline;\">\n<div class=\"column\" style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;vertical-align:baseline;\">\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:18px;font-family:inherit;font-size:13.8px;vertical-align:baseline;\"><span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\">Tworzyliśmy oświetlenie na wielkich imprezach, w stylowych restauracjach, hotelach, klubach, obiektach użyteczności publicznej i pięknych przestrzeniach mieszkalnych. Z największą przyjemnością realizujemy nietypowe pomysły. Projekty wykonujemy lokalnie oraz na terenie całej Europy. Nasi projektanci i rzemieślnicy to jedni z najbardziej doświadczonych specjalistów na rynku, dla których im trudniejsze wyzwanie, tym większa motywacja i satysfakcja.</span></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:18px;font-family:inherit;font-size:13.8px;vertical-align:baseline;\"></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:18px;font-family:inherit;font-size:13.8px;vertical-align:baseline;\"></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:18px;font-family:inherit;font-size:13.8px;vertical-align:baseline;\"><span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:13.8px;vertical-align:baseline;\"><img src=\"https://bylight.pl/img/cms/Zdj%C4%99cia%20z%20Katalogu/3.jpg\" alt=\"tp5.png\" width=\"670\" height=\"550\" style=\"margin:4px 0px 17px;padding:0px;border:0px;line-height:inherit;font-size:13px;vertical-align:middle;width:679.612px;height:auto;\" /></span></p>\n<h2 style=\"margin:40px 0px;padding:0px;border:0px;font-weight:500;line-height:60px;font-family:PlayFairRegular;font-size:44px;vertical-align:baseline;color:#28282a;\">ByLight to nie tylko sklep z oświetleniem i akcesoriami.</h2>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-size:13.8px;vertical-align:baseline;\">Światło, które nie tylko oświetla wnętrze, ale również je tworzy, to nasza pasja. Nasza pracownia od lat dostarcza unikatowe rozwiązania w prostych formach, które odnajdują się w designerskich wnętrzach. Czy to loft z prawdziwego zdarzenia, czy też małe przytulne M2, wybór lamp designerskich w ByLight, pozwoli na dobranie czegoś odpowiedniego.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:18px;font-family:inherit;font-size:13.8px;vertical-align:baseline;\"></p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-size:13.8px;vertical-align:baseline;\">W sklepie ByLight, znajdują się lampy wiszące, kinkiety, lampki biurkowe, nocne oraz gadgety takie jak np przedłużacze na kolorowych kablach. Ponadto w ofercie sklepu znajduje się szeroka gama akcesoriów, dzięki którym można zbudować własną lampę.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-size:13.8px;vertical-align:baseline;\"><img src=\"https://bylight.pl/img/cms/Zdj%C4%99cia%20z%20Katalogu/12.jpg\" alt=\"tp1.png\" width=\"670\" height=\"550\" style=\"margin:4px 0px 17px;padding:0px;border:0px;line-height:inherit;font-size:13px;vertical-align:middle;width:679.612px;height:auto;\" /></p>\n<h2 style=\"margin:40px 0px;padding:0px;border:0px;font-weight:500;line-height:60px;font-family:PlayFairRegular;font-size:44px;vertical-align:baseline;color:#28282a;\">Oryginalne żarówki Edisona.</h2>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-size:13.8px;vertical-align:baseline;\">W dziale Żarówki Dekoracyjne znajdują się między innymi oryginalne żarówki Edisona, w których węglowy żarnik mieni się w żółto-pomarańczowej palecie barw. Skomplikowane wzory żarników są ręcznie zaplatane, a po rozpaleniu ukazują swoje całe piękno. W ofercie znajdują się zarówno żarówki o klasycznym kształcie Edisona, jak i inne okrągłe oraz podłużne, które przypominają probówkę.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-size:13.8px;vertical-align:baseline;\">ByLight oferuje również żarówki ozdobne w nowoczesnej technologii LED, gdzie diody LED ułożone są na kształt oryginalnej żarówki Edisona. Wszędzie tam gdzie potrzebne jest więcej światła, proponujemy żarówki halogenowe, w klasycznych kształtach żarówek Edisona. Zachęcamy również do zapoznania się z ofertą żarówek dekoracyjnych mlecznych.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-size:13.8px;vertical-align:baseline;\"><img src=\"https://bylight.pl/img/cms/tp2.png\" alt=\"tp2.png\" width=\"670\" height=\"550\" style=\"margin:4px 0px 17px;padding:0px;border:0px;line-height:inherit;font-size:13px;vertical-align:middle;width:679.612px;height:auto;\" /></p>\n<h2 style=\"margin:40px 0px;padding:0px;border:0px;font-weight:500;line-height:60px;font-family:PlayFairRegular;font-size:44px;vertical-align:baseline;color:#28282a;\">Kolejnym elementem układanki są kolorowe kable.</h2>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-size:13.8px;vertical-align:baseline;\">W ByLight oferujemy szeroką paletę kilkudziesięciu kolorów kabli w oplocie polyestrowym. Od klasycznej zebry jak z żelazka, przez krwistą czerwień aż różową magentę. Posiadamy również kolorowe przedłużacze.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-size:13.8px;vertical-align:baseline;\">Ponadto w ofercie sklepu znajdują się liczne akcesoria, dzięki którym lampa nabierze charakteru, ale najważniejsze jest to że proces projektowania lampy jest teraz po stronie Klienta! Wystarczy wybrać po kolei wszystkie elementy i gotowe. Można zamówić same elementy lampy i zbudować ją samemu, lub zostawić to nam. Wtedy lampa przyjdzie gotowa do zawieszenia.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-size:13.8px;vertical-align:baseline;\"><img src=\"https://bylight.pl/img/cms/tp3.png\" alt=\"tp3.png\" width=\"670\" height=\"504\" style=\"margin:4px 0px 17px;padding:0px;border:0px;line-height:inherit;font-size:13px;vertical-align:middle;width:679.612px;height:auto;\" /></p>\n<h2 style=\"margin:40px 0px;padding:0px;border:0px;font-weight:500;line-height:60px;font-family:PlayFairRegular;font-size:44px;vertical-align:baseline;color:#28282a;\">Jesteśmy otwarci na pomysły naszych klientów.</h2>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-size:13.8px;vertical-align:baseline;\">W ten sposób powstało wiele pięknych, mniejszych i większych lamp, które cały czas sprawiają radość, dając ciepłą atmosferę i niesamowite doznania. Często realizujemy też bardzo skomplikowane instalacje, które zapierają dech w piersiach.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-size:13.8px;vertical-align:baseline;\">Takie niestandardowe przedsięwzięcia pozwalają nam na przekraczanie kolejnych granic i robieniu coraz ciekawszych lamp dla naszych klientów.</p>\n<p style=\"margin:0px 0px 18px;padding:0px;border:0px;line-height:18px;font-size:13.8px;vertical-align:baseline;\"><img src=\"https://bylight.pl/img/cms/Zdj%C4%99cia%20z%20Katalogu/2_2.jpg\" alt=\"tp4.png\" width=\"670\" height=\"550\" style=\"margin:4px 0px 17px;padding:0px;border:0px;line-height:inherit;font-size:13px;vertical-align:middle;width:679.612px;height:auto;\" /></p>\n</div>\n</div>\n</div>\n</div>\n</div>','o-nas');
