('4','1','','<h2 style=\"margin:0px;padding:0px;border:0px;font-weight:400;line-height:42.5px;font-family:PlayFairRegular;font-size:32px;vertical-align:baseline;color:#f7f8fa;float:left;clear:both;\">Ręcznie wykonywane lampy.</h2>\n<div class=\"delim\" style=\"margin:13px 0px 5px;padding:0px;border:0px;line-height:inherit;font-family:\'montserrat_light\';font-size:13px;vertical-align:baseline;float:left;clear:both;width:60px;height:3px;background-color:#ffffff;color:#7e7b90;\"></div>\n<p style=\"margin:0px 0px 9px;padding:.5em 0px;border:0px;line-height:24px;font-family:\'montserrat_light\';font-size:14.4px;vertical-align:baseline;color:#ffffff;float:left;clear:both;\">W ByLight sami projektujemy i wykonujemy lampy, kinkiety i akcesoria. Nasi rzemieślnicy tworzą oświetlenie ręcznie w 100% w Polsce.</p>','','https://cdn3.bylight.waynet.pl/modules/homeslider/images/ac46536ae17b2f6963fcb12a181a942a02e734b6_3a.jpg','92be24d1a9e00e8bcb37fed6862f38330c1173bb_banner_1.jpg'),
('5','1','','<h2 style=\"margin:0px;padding:0px;border:0px;font-weight:400;line-height:42.5px;font-family:PlayFairRegular;font-size:32px;vertical-align:baseline;color:#f7f8fa;float:left;clear:both;\">Lampy według Twojego projektu.</h2>\n<div class=\"delim\" style=\"margin:13px 0px 5px;padding:0px;border:0px;line-height:inherit;font-family:\'montserrat_light\';font-size:13px;vertical-align:baseline;float:left;clear:both;width:60px;height:3px;background-color:#ffffff;color:#7e7b90;\"></div>\n<p style=\"margin:0px 0px 9px;padding:.5em 0px;border:0px;line-height:24px;font-family:\'montserrat_light\';font-size:14.4px;vertical-align:baseline;color:#ffffff;float:left;clear:both;\">Masz szkic, rysunek, wizualizację albo opis upragnionej lampy? Chętnie podzielimy się swoim doświadczeniem i wyprodukujemy lampę specjalnie dla Ciebie.</p>\n<p style=\"margin:0px 0px 9px;padding:.5em 0px;border:0px;line-height:24px;font-family:\'montserrat_light\';font-size:14.4px;vertical-align:baseline;color:#ffffff;float:left;clear:both;\">Metale szlachetne, galwanika lub lakierowanie proszkowe czy natryskowe - to wszystko wchodzi w grę. Napisz do nas ze swoim projektem i stwórzmy to dzieło razem!</p>','','https://cdn2.bylight.waynet.pl/modules/homeslider/images/9fd81405f72096c4492c8b6c4a97e6e872fe12cc_202102070213310.jpg','e5cad9a989219ab01ff6f4a341eecf65c7fa7364_banner_2.jpg'),
('6','1','','<h2 style=\"margin:0px;padding:0px;border:0px;font-weight:400;line-height:42.5px;font-family:PlayFairRegular;font-size:32px;vertical-align:baseline;color:#f7f8fa;float:left;clear:both;\">Lampy Soul</h2>\n<div class=\"delim\" style=\"margin:13px 0px 5px;padding:0px;border:0px;line-height:inherit;font-family:\'montserrat_light\';font-size:13px;vertical-align:baseline;float:left;clear:both;width:60px;height:3px;background-color:#ffffff;color:#7e7b90;\"></div>\n<p style=\"margin:0px 0px 9px;padding:.5em 0px;border:0px;line-height:24px;font-family:\'montserrat_light\';font-size:14.4px;vertical-align:baseline;color:#ffffff;float:left;clear:both;\"><span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;line-height:inherit;font-family:inherit;font-size:14.4px;vertical-align:baseline;\">Piękno polskiego rzemiosła w najlepszej postaci. Sam wybierasz<br />rodzaj i kolor wykończenia tych lamp. Możemy je dla Ciebie<br />galwanizować lub lakierować w wybrany kolor z palety RAL.</span></p>','','https://cdn3.bylight.waynet.pl/modules/homeslider/images/4474cc0e192a0efbbc77383db0cc678ced6cbd6b_soul%20czarno%20biala.jpg','c1b8c299aef892a5431bdee2ffcee4fe483f3606_banner_3.jpg');
