('1','1','Quality');
INSERT INTO `ps_product_lang` VALUES
('1','1','1','<p>Metalowa lampa w całości produkowana przez ByLight w Polsce.</p>\n<p>Mysiądz</p>\n<p>Czas realizacji około 7 dni roboczych.</p>\n<p>Materiał: czysty mosiądz</p>\n<p>W zestawie nie ma żarówki - zapraszamy do działu żarówki dekoracyjne aby wybrać pożądany model.</p>','<dl><dt>Wysokość</dt><dd>8,3 cm</dd><dt>Średnica</dt><dd>26,5 cm</dd><dt>Długość kabla</dt><dd>2 m</dd><dt>Moc</dt><dd>Max 60W</dd><dt>Gwint</dt><dd>E27</dd></dl>','lampa-bylight-jazz-mosiadz','Meta description-1','Meta keywords-1','Meta title-1','Lampa ByLight Jazz Mosiądz','Dostępny','Niedostępny',NULL,NULL),
('2','1','1','<p>Bylight Soul - Jak z modnej kawiarenki </p><p>Bylight Soul to projekt naszej warszawskiej ekipy, który pokochały kawiarnie z całej Polski - świetnie wpasowują się w klimat chillout’u - najlepiej w otoczeniu gołych cegieł i drewnianych krzeseł, kiedy w powietrzu unosi się zapach świeżo zmielonej kawy. To lampa, która dobrze czuje się w kuchni czy jadalni, nadając jej świetny, unikalny klimat. Wybierz lampę Bylight Soul do swojego domu - do wyboru masz różne kolory, choć możesz zawsze wybrać klasyczną czerń lub biel. </p><p>Czas realizacji około 7 dni roboczych.</p><p>Materiał: metal, stal surowa.</p><p>Ze względu na to, iż stal surowa rdzewieje, po pewnym czasie lampa zacznie delikatnie korodować. Aby przywrócić jej blask można ją wtedy wypolerować pasta do metalu. </p><p>Jeżeli nie chcemy efektu starzenia proponujemy polakierowanie lampy lakierem bezbarwnym - poniżej w menu można wybrać taką opcję.</p><p></p><p>W zestawie nie ma żarówki - zapraszamy do działu żarówki dekoracyjne aby wybrać pożądany model.</p>','<dl><dt>Wysokość</dt><dd>18,5 cm</dd><dt>Średnica</dt><dd>42,5 cm</dd><dt>Długość kabla</dt><dd>2 m</dd><dt>Moc</dt><dd>Max 60W</dd><dt>Gwint</dt><dd>E27</dd></dl>','lampa-bylight-soul-02-surowa','Meta description-2','Meta keywords-2','Meta title-2','Lampa Bylight Soul 02 Surowa','Dostępny','Niedostępny',NULL,NULL),
('3','1','1','<p>Lampa 100% ręcznie wykonana przez ByLight w Warszawie. </p><p>Wykonana ze stali posiada 6 oprawek na żarówki. Galwanizowana w mosiądz.</p><p> Do lampy pasują żarówki Edisona, mleczne, halogenowe i LED-owe. </p><p>Żarówek nie ma w zestawie. Zapraszamy do działu z żarówkami w celu wybrania odpowiednich żarówek.</p><p>Lampa wykonana z mosiądzu - ulega procesowi starzenia.</p><p>Czas realizacji około 7 dni roboczych.</p>','<dl><dt>Wysokość</dt><dd>35 cm</dd><dt>Szerokość</dt><dd>55 cm</dd><dt>Długość kabla</dt><dd>2 m</dd><dt>Moc</dt><dd>Max 60W</dd><dt>Gwint</dt><dd>E27</dd><dt>Napięcie</dt><dd>230V</dd></dl>','lampa-rhythm-mosiadz','Meta description-3','Meta keywords-3','Meta title-3','Lampa Rhythm Mosiądz','Dostępny','Niedostępny',NULL,NULL),
('4','1','1','<p>Mosiężna lampa w całości produkowana przez ByLight w Polsce.</p><p>Mosiądz szczotkowany zabezpieczony lakierem bezbarwnym.</p><p>Czas realizacji około 14 dni roboczych.</p><p>Materiał: metal i szkło.</p><p>Możesz wybrać między kloszem matowym lub błyszczącym.</p><p>W zestawie nie ma żarówki - zapraszamy do działu żarówki dekoracyjne aby wybrać pożądany model.</p><p>NA ZAMÓWIENIE MOŻEMY PRZYGOTWAĆ DOWOLNĄ DŁUGOŚĆ SZTYCY LAMPY - KRÓTSZĄ LUB DŁUŻSZĄ</p>','<dl><dt>Wysokość</dt><dd>82 cm</dd><dt>Średnica</dt><dd>30 cm</dd><dt>Moc</dt><dd>Max 60W</dd><dt>Gwint</dt><dd>G9</dd></dl>','lampa-bylight-b30-mosiadz-klosz-miodowy','Meta description-4','Meta keywords-4','Meta title-4','Lampa ByLight B30 Mosiądz - klosz miodowy','Dostępny','Niedostępny',NULL,NULL),
