('33','1','1','<p>Bylight Trio - Bo jedna to za mało </p><p>Lampy Bylight Trio to geometryczna, przestrzenna forma, która doskonale pasuje do wnętrz utrzymanych w stylistyce nowoczesnej, loftowej i skandynawskiej. Lampy Bylight z linii Trio dostępne są w kilku kolorach tak, abyś mógł wybrać dla siebie tą Jedyną, idealnie kontrastującą z przestrzenią wokół Ciebie. Wszystkie lampy Bylight są naszego autorstwa, zaprojektowane i wykonywane przez najlepszych polskich rzemieślników z Warszawy. To właśnie dzięki temu są takie popularne - unikatowe, 100% handmade i z metką „Stworzone w Polsce”. </p><p></p><p>W zestawie nie ma żarówki - zapraszamy do działu żarówki dekoracyjne aby wybrać pożądany model.</p>','<dl><dt>Wysokość</dt><dd>25 cm</dd><dt>Szerokość</dt><dd>35 cm</dd><dt>Długość kabla</dt><dd>2 m</dd><dt>Moc</dt><dd>Max 60W</dd><dt>Gwint</dt><dd>E27</dd></dl>','lampa-trio-czarna','Meta description-33','Meta keywords-33','Meta title-33','Lampa Trio Czarna','Dostępny','Niedostępny',NULL,NULL),
