('224','1','1','<p>Bylight Trio Stick - Bo jedna to za mało </p><p>Lampy Bylight Trio to geometryczna, przestrzenna forma, która doskonale pasuje do wnętrz utrzymanych w stylistyce nowoczesnej, loftowej i skandynawskiej. Lampy Bylight z linii Trio dostępne są w kilku kolorach tak, abyś mógł wybrać dla siebie tą Jedyną, idealnie kontrastującą z przestrzenią wokół Ciebie. Wszystkie lampy Bylight są naszego autorstwa, zaprojektowane i wykonywane przez najlepszych polskich rzemieślników z Warszawy. To właśnie dzięki temu są takie popularne - unikatowe, 100% handmade i z metką „Stworzone w Polsce”. </p><p></p><p>W zestawie nie ma żarówek - zapraszamy do działu żarówki dekoracyjne aby wybrać pożądany model.</p><p>Czas realizacji około 10 dni roboczych.</p>','<dl><dt>Długość kabla</dt><dd>2 m</dd><dt>Moc</dt><dd>Max 60W</dd><dt>Gwint</dt><dd>E27</dd></dl>','lampa-bylight-trio-stick-biala','Meta description-224','Meta keywords-224','Meta title-224','Lampa Bylight Trio Stick  Biała','Dostępny','Niedostępny',NULL,NULL),
