INSERT INTO `ps_translation` VALUES
('1','1','When a customer returns a product, a credit slip must be created in his favor. Generate vouchers and have a look at their follow-up.','Gdy klient zwraca produkt, musi zostać sporządzony dokument kredytowy na jego korzyść. Wygeneruj kupony i spójrz na ich kontynuację.','AdminCatalogFeature',NULL),
('2','1','Manage your credit slips','Zarządzaj kartami kredytowymi','AdminCatalogFeature',NULL),
('3','1','Make some files available to your customers and facilitate their purchasing environment by adding them just here! It can be instruction manuals, technical works or anything you want to attach to a product.','Udostępnij niektóre pliki swoim klientom i usprawnij ich środowisko zakupowe, dodając je właśnie tutaj! Mogą to być instrukcje obsługi, prace techniczne lub cokolwiek, co chcesz dołączyć do produktu.','AdminCatalogFeature',NULL),
('4','1','You can specify product reference(s) for each associated supplier. Click \"%save_label%\" after changing selected suppliers to display the associated product references.','Możesz określić referencje produktu dla każdego powiązanego dostawcy. Kliknij „%save_label%” po zmianie wybranych dostawców, aby wyświetlić powiązane referencje produktów.','AdminCatalogHelp',NULL),
('5','1','To add combinations, you first need to create proper attributes and values in [1]%attributes_and_features_label%[/1]. <br> When done, you may enter the wanted attributes (like \"size\" or \"color\") and their respective values (\"XS\", \"red\", \"all\", etc.) in the field below; or simply select them from the right column. Then click on \"%generate_label%\": it will automatically create all the combinations for you!','Aby dodać kombinacje, musisz najpierw utworzyć odpowiednie atrybuty i wartości w [1]%attributes_and_features_label%[/1]. <br> Po zakończeniu możesz wprowadzić żądane atrybuty (takie jak „rozmiar” lub „kolor”) i ich odpowiednie wartości („XS”, „czerwony”, „wszystkie” itp.) w polu poniżej; lub po prostu wybierz je z prawej kolumny. Następnie kliknij „%generate_label%”: automatycznie utworzy dla Ciebie wszystkie kombinacje!','AdminCatalogHelp',NULL),
('6','1','This will copy the images too. If you wish to proceed, click \"%yes_label%\". If not, click \"%no_label%\".','Spowoduje to również skopiowanie obrazów. Jeśli chcesz kontynuować, kliknij „%yes_label%”. Jeśli nie, kliknij „%no_label%”.','AdminCatalogNotification',NULL),
('7','1','Simple HTML table display','Wyświetlanie prostej tabeli HTML','ModulesGridhtmlAdmin',NULL),
('8','1','Mail alerts','Alerty pocztowe','ModulesEmailalertsAdmin',NULL),
('9','1','Make your everyday life easier, handle mail alerts about stock and orders, addressed to you as well as your customers.','Ułatw sobie codzienne życie, obsługuj powiadomienia mailowe o stanach magazynowych i zamówieniach skierowane zarówno do Ciebie, jak i Twoich klientów.','ModulesEmailalertsAdmin',NULL),
('10','1','Cannot update settings','Nie można zaktualizować ustawień','ModulesEmailalertsAdmin',NULL),
